import * as React from 'react';
import PropTypes from 'prop-types';
import TextField from '../../components/TextField/TextField';

const TextFieldDemo = () => {
  <div>
    <h3><b>This is Disabled Input</b></h3>
    <TextField type="text" value="Disable Input" size="32" disabled />
    <h3><b>A Valid Input</b></h3>
    <TextField type="text" value="Accessible" disabled={false} size="32" />
    <h3><b>An Input with errors</b></h3>
    <input type="text" value="101" size="32" />
  </div>;
};

TextFieldDemo.propTypes = {
  value: PropTypes.string.isRequired,
  error: PropTypes.string.isRequired,
  disabled: PropTypes.string.isRequired,
};
export default TextFieldDemo;
